import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import API from "src/axios/axios";
import { providerStoreAction } from "src/store/store";
import classes from "./IpgProvider.module.css";
const IpgProvider = () => {
  const mapStateToProps = (state) => {
    return {
      providerData: state.providerStore.providerData,
    };
  };
  const state = useSelector(mapStateToProps);
  const dispatch = useDispatch();
  useEffect(() => {
   dispatch(providerStoreAction.getProviderData);
  }, []);
  return (
    <>
      <h1 className={classes.color}>Welcome To IPG Provider</h1>
    </>
  );
};

export default IpgProvider;
